import React from "react";
import { Data } from "../data";

function Name(){
  return (
    <>
      <div className="name-container">
        {
          this.state.Data.map((item)=>
            <div>
              <div>{item.name}
            </div>
              <ul>
                {item.Slots.map((sub)=>
                <li>
                  {sub.key='unique'}
                </li>
                )}
              </ul>
            </div>
          )
        }
      </div>
    </>
  );
}
export default Name;
